constructor() {
  super();
  this.state = {
    route: '',
  }
  }

onRouteChange = (route) => {
  this.setState({route: route});
}


  render() {
    const { route } = this.state;

  return (
    <div className="App">
      <header className="App-header">
            <Navigation onRouteChange={this.onRouteChange}/>
        <h1>
          William Cragg
        </h1>
        <h2>
          Full-Stack Developer
        </h2>
      </header>

    </div>
  );
}
}


export default App;
